import './App.css';
import BottomBar from './components/bottom-bar.js';
import { AboutMeFolderGroup } from './components/AboutMeFolderIcon.js';
import { MyComputerGroup, ComputerPopUp } from './components/MyComputerGroup.js';
import "98.css";


function App() {
  return (
    <div className="App"> 
      <header className="App-header">
        <body>
        <MyComputerGroup />
        <AboutMeFolderGroup />
        <ComputerPopUp></ComputerPopUp>
        <Popup
          trigger={<button className="button">Open Popup</button>}
          position="right center"
          closeOnDocumentClick
        >
          <div>Popup Content</div>
        </Popup>


        </body>

      </header>
      <BottomBar>  
      </BottomBar>
    </div>

  );
}



export default App;
